import React from 'react';
import classes from './DishMenu.module.css';
import dish1 from '../../../../assests/Images/dish1.jpg';
const DishMenu = (props) => {
    return (
        <div className = {classes.DishMenu}>
            <img src = {dish1} alt="dish1"/>
            <div className = {classes.AddMinusBar}>
                <button onClicked ={props.added}>+</button>
                <span>4{props.dishCount}</span>
                <button>-</button>
            </div>
            <p>Price: {props.price}</p>
        </div>
    )
}
export default DishMenu;
